 to solve the following problem:

> Let $G$ be a group and $H$ be a subgroup of $G$. Prove that the set $G/H$ of cosets of $H$ in $G$ is a group under the operation of multiplication defined by $(g_1H)(g_2H) = g_1g_2H$.

Here's a Python code base on group theory to solve the problem. This code defines a `Group` class and a `Subgroup` class, and then uses these classes to create a group $G$ and a subgroup $H$. It then defines the operation of multiplication on cosets and proves that $G/H$ is a group.

```python
from typing import List

class Group:
    def __init__(self, elements: List, operation: callable):
        self.elements = elements
        self.operation = operation

    def __contains__(self, element):
        return element in self.elements

    def __mul__(self, other):
        return self.operation(self, other)

    def inverse(self, element):
        for e in self.elements:
            if e * element == self.identity():
                return e
        raise ValueError(f"Inverse of {element} does not exist in the group.")

    def identity(self):
        for e in self.elements:
            if e * e == e:
                return e

